import React from 'react'
import FiltroApp from './components/FiltroApp'
import personas from './personas'

const ListaApp = () => {
    return (
        <>
            <h2>Personas</h2>
            <FiltroApp />
            <hr/>
            <ol>
                {
                    personas.map(
                        (persona) => <li key={persona}>{persona}</li>
                    )
                }
            </ol>
        </>
    )
}

export default ListaApp
